import React from "react";
import "../styles/navbarS.css"
import logo from "../assets/logo.png"

const NavbarS = function() {
  return (
    <div className="Title">
      <img src = {logo} alt = "Logo"/>
      <div className="Title-Subtitle">Ростелеком</div>
    </div>
  )
}

export default NavbarS;
